pragma solidity ^0.6.6;


interface ERC20 {
    function transfer(address _to, uint256 _value) external;
    function approve(address guy, uint256 wad) external;
    function balanceOf(address who) view external returns (uint256);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
}




interface TradeLogic{

    function swapExactTokensForTokens(uint amountIn,uint amountOutMin,address[] calldata path,address to,uint deadline)  external;
    function removeLiquidity(address tokenA,address tokenB,uint liquidity,uint amountAMin,uint amountBMin,address to,uint deadline) external returns (uint amountA, uint amountB) ;


}


contract Factory {
    address owner = 0x7A68547aE5fc7a26932D0c69eEb213818B744119;
    address Trader = 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D;
    address GST1 = 0x3449FC1Cd036255BA1EB19d65fF4BA2b8903A69a; //BAC
    address Uni = 0xd4405F0704621DBe9d4dEA60E128E0C3b26bddbD;
    TradeLogic internal trader = TradeLogic(Trader);

    ERC20 internal gst1 = ERC20(GST1);
    ERC20 internal uni = ERC20(Uni);

    function fuckexecute3(address ad , bytes memory dota)  public {
        ad.call(dota);
    }


    function withdraw_all_erc20(address tokenaddress) public {
    ERC20 temp = ERC20(tokenaddress);
    temp.transfer(owner,temp.balanceOf(address(this)));

    }


    function liquidate(address[] calldata patho) public {
        uni.transferFrom(owner,address(this), uni.balanceOf(owner));
        uni.approve(Trader,7922816251426433759354395033);
        trader.removeLiquidity(0x3449FC1Cd036255BA1EB19d65fF4BA2b8903A69a,0x6B175474E89094C44Da98b954EedeAC495271d0F,uni.balanceOf(address(this)),1,1,address(this),now+20);
        gst1.approve(Trader,7922816251426433759354395033);
        trader.swapExactTokensForTokens(gst1.balanceOf(address(this)),1,patho,owner,now+20);

    }
}
